import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M19.1 9.17a4.5 4.5 0 111.06-1.06l2.62 2.61a.75.75 0 11-1.06 1.06L19.1 9.17zm.4-3.67a3 3 0 10-6 0 3 3 0 006 0zm-.5 4.98v10.76c0 .62-.7.97-1.19.61l-5.8-4.18-5.82 4.18a.75.75 0 01-1.19-.6v-15C5 4.45 6.46 3 8.25 3h3.35a5.5 5.5 0 007.35 7.43l.05.05z", fill: primaryFill }));
};
const BookmarkSearch24Filled = wrapIcon(rawSvg({}), 'BookmarkSearch24Filled');
export default BookmarkSearch24Filled;
